import React from 'react'

export default function GoodInCart({game}) {
  return (
    <div className='text-white text-[24px] flex border h-25vh'>
        <p>{game.title}</p>
        <img className='object-cover' src={game.img} alt='no' />
        <p>{game.description}</p>
        <p>{game.price}</p>
    </div>
  )
}
